using System;
using System.Drawing;
using System.IO;

namespace AxTools.Helpers
{
    internal static class Resources
    {
        internal static readonly Image ApplicationImage;
        internal static readonly Icon ApplicationIcon;
        private const string applicationIcon = "";

        internal static readonly Image Close;
        private const string close = "";
        
        internal static readonly Image Plugin_Destroying;
        private const string plugin_destroying = "";

        internal static readonly Image DataBackup;
        private const string dataBackup = "";

        internal static readonly Image DataDeploy;
        private const string dataDeploy = "";

        internal static readonly Image DialogError;
        private const string dialogError = "";

        internal static readonly Image DialogInfo;
        private const string dialogInfo = "";

        internal static readonly Image DialogWarning;
        private const string dialogWarning = "";

        internal static readonly byte[] CACert;
        private const string caCert = "";

        static Resources()
        {
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(applicationIcon)))
            {
                ApplicationImage = Image.FromStream(memoryStream);
                using (Bitmap bitmap = new Bitmap(ApplicationImage))
                    ApplicationIcon = Icon.FromHandle(bitmap.GetHicon());
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(close)))
            {
                Close = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(plugin_destroying)))
            {
                Plugin_Destroying = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(dataBackup)))
            {
                DataBackup = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(dataDeploy)))
            {
                DataDeploy = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(dialogError)))
            {
                DialogError = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(dialogInfo)))
            {
                DialogInfo = Image.FromStream(memoryStream);
            }
            using (MemoryStream memoryStream = new MemoryStream(Convert.FromBase64String(dialogWarning)))
            {
                DialogWarning = Image.FromStream(memoryStream);
            }
            CACert = Convert.FromBase64String(caCert);
        }
    }
}